import React from 'react';

class AsteroidList extends React.Component {
    constructor(props) {
        super(props)

    }


    render = () => {
        var asteroid_list = []
        for (var property in this.props.asteroids) {
            asteroid_list.push(String(property) + ": " + String(this.props.asteroids[property].length))
        }
        const AsteroidMarkup = (asteroid_list > 0 &&
            asteroid_list.map(asteroid => {
                return (
                    <li className="list-group-item" data-asteroid-id={asteroid} key={asteroid}>
                        <div className="d-flex justify-content-between align-items-center">
                            <p className="m-0">{asteroid}</p>
                        </div>
                    </li>
                )

            }
            )
        )
        return (
            <div className="row mt-5 justify-content-center">
                <div className="col-sm-5">
                    <ul className="list-group">
                        {AsteroidMarkup}
                    </ul>
                </div>
            </div>
        )

    }
}

export default AsteroidList;
